import "./App.css";
import red_polish2 from "./pictures/red_polish2.png";
import red_polish1 from "./pictures/red_polish1.png";
import pink_polish from "./pictures/pink-polish.png";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h3>Olena's App</h3>
      </header>
      <div className="background-scene">
        <img src={red_polish2} className="red-polish1" alt=""></img>
        <img src={red_polish1} className="red-polish2" alt=""></img>
        <img src={pink_polish} className="pink-polish" alt=""></img>
        <img src={red_polish2} className="red-polish" alt=""></img>
        <img src={red_polish2} className="red-polish" alt=""></img>
      </div>
    </div>
  );
}

export default App;
